import React from "react";
import image from '../../assests/meals.jpg'
import classes from './Header.module.css'

const Header = props => {
    return (
        <React.Fragment>
            <header className={classes.header}>
                <h1>Meals</h1>
                <button>Cart</button>
            </header>
            <div className={classes['main-image']}>
                <img src={image} />
            </div>

        </React.Fragment>
    )
}

export default Header;
